        }
        _totalSupply -= tokenAmount;
        _totalShares -= shareAmount;

        emit Redeemed(account, tokenAmount, shareAmount);
        emit Transfer(account, address(0), tokenAmount);

        _afterTokenTransfer(account, address(0), tokenAmount);
    }

